import React from 'react';
import "./signup.css"

export default function Signup() {
  return (
    <div>
      <div className="container">
        <div className="header">
          <div className="text">Sign Up</div>
          <div className="underline"></div>
        </div>
        .inputs
      </div>
    </div>
  )
}
